INSERT INTO `daily_carbon_footprints` VALUES (1,3,'2025-09-22',28000,'오늘은 우리 숲의 나무들이 평소보다 조금 더 힘을 내야 하는 하루였어요. ? 하지만 괜찮아요, 내일은 분명 더 좋아질 거예요! ✨\n\n오늘 당신은 평균보다 1.98 kg의 탄소를 더 배출하며 지구가 조금 힘들어했답니다. ?\n\n오늘 하루 초과된 탄소는 북극의 빙하 0.00002 제곱미터를 녹일 수 있는 양이에요. ? 작은 행동이 모여 큰 변화를 만든답니다! ?\n\n혹시 내일은 식사 후에 일회용 컵 대신 개인 텀블러를 사용해보는 건 어떨까요? ? 그 작은 행동 하나가 숲에는 큰 선물이 될 거예요! ?','2025-09-22 01:22:43'),(4,8,'2025-09-22',49600,'우와! ? 오늘은 우리 숲의 나무들이 평소보다 조금 더 힘을 내야 하는 하루였어요. 하지만 괜찮아요, 내일은 분명 더 좋아질 거예요! ?\n\n오늘 당신은 평균보다 23.58 kg의 탄소를 더 배출하며 지구가 조금 힘들어했답니다. ?\n\n오늘 하루 초과된 탄소는 북극의 빙하 0.002358 제곱미터를 녹일 수 있는 양이에요. ? 작은 행동이 모여 큰 변화를 만든답니다. ✨\n\n혹시 내일은 식사 후에 일회용 컵 대신 개인 텀블러를 사용해보는 건 어떨까요? ☕ 그 작은 행동 하나가 숲에는 큰 선물이 될 거예요! ?','2025-09-22 16:54:35'),(5,4,'2025-09-22',0,'우와! ✨ 당신 덕분에 오늘 우리 숲이 아기 새처럼 포근하고 싱그러워졌어요! 정말 정말 고마워요~ ?\n\n오늘 당신은 평균보다 무려 26.02 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요! ? 정말 대단하세요!\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요! ? 덕분에 숲이 더욱 건강해졌답니다. ?\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! 파이팅! ?','2025-09-22 17:32:17'),(6,8,'2025-09-23',43400,'오늘도 우리 숲을 위해 애써주셔서 정말 감사해요! ?✨ 하지만 오늘 당신의 발자국이 평소보다 조금 무거웠던 것 같아요. ?\n\n오늘 당신은 한국인 평균(26.02kg)보다 17.38kg 더 많은 탄소를 배출했어요. ?\n\n오늘 당신이 더 배출한 탄소는 30년생 소나무 한 그루가 꼬박 4일 동안 흡수해야 할 양과 같아요. ? 조금만 더 노력하면 우리 숲이 더 건강해질 수 있어요! ?\n\n내일은 점심 식사를 할 때, 혹시 일회용기 대신 개인 도시락을 이용해보는 건 어떨까요? ? 그 작은 실천 하나가 숲에는 큰 응원이 될 거예요! ?','2025-09-23 10:24:57'),(7,4,'2025-09-23',35630,'힝, 오늘은 우리 숲이 조금 힘든 날이었나 봐요... ? 하지만 괜찮아요! 코코가 항상 곁에서 응원할게요! ?\n\n오늘 당신은 한국 평균보다 9.61 kg의 탄소를 더 배출하며 지구가 조금 힘들어했답니다. ?\n\n오늘 하루 초과된 탄소는 북극의 빙하 0.48 제곱미터를 녹일 수 있는 양이에요. ? 작은 행동이 모여 큰 변화를 만든답니다. ?\n\n혹시 내일은 식사 후에 일회용 컵 대신 개인 텀블러를 사용해보는 건 어떨까요? ? 그 작은 행동 하나가 숲에는 큰 선물이 될 거예요. ?','2025-09-23 10:51:57'),(8,3,'2025-09-23',28000,'아이쿠! ? 오늘은 우리 숲의 나무들이 평소보다 조금 더 힘을 내야 하는 하루였어요. 하지만 괜찮아요, 내일은 분명 더 좋아질 거예요! ?✨\n\n오늘 당신은 평균보다 1.98 kg의 탄소를 더 배출하며 지구가 조금 힘들어했답니다. ?\n\n오늘 하루 초과된 탄소는 30년생 소나무 한 그루가 꼬박 4.5일 동안 흡수해야 하는 양과 같아요. ??\n\n혹시 내일은 식사 후에 일회용 컵 대신 개인 텀블러를 사용해보는 건 어떨까요? 그 작은 행동 하나가 숲에는 큰 선물이 될 거예요! ?➡️?','2025-09-23 13:57:43'),(9,4,'2025-09-24',1820,'꺄르르~ ✨ 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! 정말 고마워요! ?\n\n오늘 당신은 평균보다 24.20 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요! ?‍♀️\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요! ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! ?','2025-09-24 09:23:06'),(10,8,'2025-09-24',0,'꺄! 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! 정말 고마워요! ?✨\n\n오늘 당신은 평균보다 26.02 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요. 정말 대단해요! ?\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요. 숨쉬는 공기가 더 맑아진 기분이에요! ?️?\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! ?‍♀️','2025-09-24 10:19:16'),(11,4,'2025-09-25',0,'와아! ?‍♀️ 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! 정말 고마워요. ?\n\n오늘 당신은 평균보다 26.02 kg의 탄소를 절약하며 지구를 아주 가볍게 만들어 주셨네요! ?️\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요! ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️ 숲이 언제나 당신을 응원할게요! ✨','2025-09-25 09:42:51'),(12,8,'2025-09-25',0,'우와! ✨ 오늘은 당신 덕분에 우리 숲이 정말 숨통이 트이는 날이에요! ? 정말 정말 고마워요! ?\n\n오늘 당신은 평균보다 무려 26.02 kg의 탄소를 절약하며, 지구에게 정말 큰 선물을 주셨네요! ?\n\n이렇게 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기처럼, 숲 전체에 생기를 불어넣어 주는 것과 같아요! ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리는 신나는 발걸음으로 걸어보는 건 어떨까요? ? 숲이 언제나 당신의 초록빛 발걸음을 응원할게요! ?','2025-09-25 10:07:39'),(13,4,'2025-09-26',0,'와아~! ?‍♀️ 당신의 숨결 덕분에 오늘 우리 숲이 반짝반짝 빛나는 것 같아요! 정말 대단해요! ✨\n\n오늘 당신은 평균보다 무려 26.02 kg의 탄소를 절약하며 지구를 정말 가볍게 만들어 주셨어요. ?️\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요. ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ? 숲이 언제나 당신을 응원할게요! ?','2025-09-26 09:25:47'),(14,8,'2025-09-26',680,'✨ 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! 정말 고마워요! ??\n\n오늘 당신은 평균보다 25.34 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요. ??\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요. ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️? 숲이 언제나 당신을 응원할게요! ?','2025-09-26 09:59:15'),(15,8,'2025-09-27',0,'우와! ✨ 당신의 오늘 덕분에 우리 숲이 더 환하게 빛나요! 정말 고마워요! ??\n\n오늘 당신은 평균보다 26.02 kg의 탄소를 절약하며 지구를 정말 가볍게 만들어 주셨어요! ?\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요! ??\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! ?','2025-09-27 16:28:27'),(16,4,'2025-09-28',340,'와아! ? 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! 정말 고마워요~ ?✨\n\n오늘 당신은 평균보다 25.68 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요! ?\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요! ?️?\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! ??','2025-09-28 14:41:24'),(17,8,'2025-09-28',630,'우와! 당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! ? 정말 고마워요, 코코가 힘이 불끈 나는걸요! ✨\n\n오늘 당신은 평균보다 무려 25.39 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요. ☁️ 정말 대단해요!\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요. ?? 숲이 당신 덕분에 더욱 싱그럽게 숨 쉬고 있어요!\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요! ?','2025-09-28 16:04:30'),(18,8,'2025-09-29',630,'당신의 멋진 하루 덕분에 오늘 우리 숲이 한결 더 푸르러졌어요! ?✨ 정말 고마워요!\n\n오늘 당신은 평균보다 25.39 kg의 탄소를 절약하며 지구를 가볍게 만들어 주셨네요. ?\n\n오늘 당신이 아껴준 탄소는 30년생 소나무 한 그루가 꼬박 일주일 동안 우리에게 선물하는 상쾌한 공기와 같아요. ?️?\n\n내일도 오늘처럼 딱 한 번만 더 가까운 거리를 걸어보는 건 어떨까요? ?‍♀️?‍♂️ 숲이 언제나 당신을 응원할게요!','2025-09-29 09:19:51');
